import { Button } from "@mui/material";
import React from "react";
import { useLocation, useNavigate, useParams } from "react-router-dom";

const UserDetails = () => {
  const params = useParams();
  const navigate = useNavigate();
  const mystyle = {
    backgroundImage: "url('/backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  const { name } = params;
  const location = useLocation();
  console.log(" Location data from user Details", location);
  let { state } = location;
  console.log("state is ", state);
  console.log(typeof state);
  const convertedJsonString = state
    // Wrap keys and values in double quotes
    .replace(/([a-zA-Z0-9_]+)(:)/g, '"$1"$2')
    .replace(/:/g, ':"')
    .replace(/,/g, '","')
    .replace(/}/g, '"}');
  let stateJSON = JSON.parse(convertedJsonString);
  let userName = stateJSON.name;
  let userEmail = stateJSON.email;
  console.log("username is ", userName);
  console.log("useremail is ", userEmail);

  return (
    <div style={mystyle}>
      <h1>UserDetails</h1>
      <br />
      <h2> This is {name} Users data.</h2>
      <h3>Data from location:</h3>
      <h4>Name: {stateJSON.name}</h4>
      <h4>Email: {stateJSON.email}</h4>

      {/* <Button onClick={}> Back to User List</Button> */}
      <br></br>
      <Button
        onClick={() => {
          navigate("/users");
        }}
        style={{
          textDecoration: "none",
          color: "white",
          backgroundColor: "#FFB300",
        }}
      >
        Back To User List
      </Button>
      <br></br>
      <br></br>

      <Button
        style={{
          textDecoration: "none",
          color: "white",
          backgroundColor: "#FFB300",
        }}
        onClick={() => {
          navigate("/");
        }}
      >
        Go To Home Page
      </Button>
    </div>
  );
};

export default UserDetails;
